import React, { Fragment } from 'react';

const calendar = () => {
  console.log('calendar');
  const today = new Date();
  const date = new Date();

  console.log(today);
  
  return (
    <Fragment>
      <h1>calendar</h1>
      <table align="center" id="calendar_table"> 
        <tr>
          <td><p>prev</p></td>
          <td colSpan="5">현재날짜</td>
          <td><p>next</p></td>
        </tr>
      </table>
    </Fragment>
  );
};

export default calendar;
